description:
FreeRIP is a Windows application that lets you save audio CD tracks to Wav, MP3, WMA, Ogg Vorbis or FLAC audio files (this process is known as ripping).
FreeRIP is also a audio file and mp3 converter and it can convert audio files from one of the named formats to another.
E.G. FreeRIP can convert a WAV file to MP3 or a FLAC file to MP3, and so on.
